`timescale 1ns / 10ps


module SignalPreAnalysis(
    input clk,
    input reset,
    input [1:0] select, // select bram
    input [15:0] sound_input, // sound input from bram
    input log10_result_Wready,
    output reg [8:0] bram_addr, // bram address
    output bram_A_enable,
    output bram_B_enable,
    output bram_C_enable, 
    output reg bram_write_enable, // write = 1, read = 0
    output reg [15:0] log10_result,
    output reg log10_result_Rready,
	output reg fftoff
    );
reg [2:0]NS, CS;
reg [15:0]hw_result[1023:0];
reg [15:0]fft_result[511:0];
reg mfscon;
reg [1:0] recent_select;
reg [2:0] bram_enable; // enable one of the brams(A or B or C)
reg bram_count;
assign bram_A_enable = bram_enable[2];
assign bram_B_enable = bram_enable[1];
assign bram_C_enable = bram_enable[0];

parameter Initial = 3'd0, HWcal = 3'd1,SIwait = 3'd2, FFTcal = 3'd3, Melcal = 3'd4, Logtable = 3'd5, mfscout = 3'd6, waitram = 3'd7;

reg [9:0]hammingwindowAddr;
wire [15:0]HW_sel;
wire [15:0] partHWresult16;
reg hammingwindowEnable;
reg SIread;
hamming_bank U0(.addra(hammingwindowAddr), .clka(clk), .douta(HW_sel), .ena(hammingwindowEnable));

reg[15:0] fft_input;
reg fft_s_axis_data_tvalid;
reg fft_s_axis_data_tlast;
wire fft_s_axis_data_tready;
wire fft_m_axis_data_tvalid;
wire fft_data_tvalid;
wire [15:0]fftout;
reg [9:0]fftinCount;
reg [8:0]fftoutCount;
reg fftfinish;

reg div_clk;
fft_modulus U1(clk, div_clk, reset, fft_input, fft_s_axis_data_tvalid, fft_s_axis_data_tlast,
fft_s_axis_data_tready, fft_m_axis_data_tvalid, fft_data_tvalid, fftout);

reg melbankEnable;
reg melfinish;
reg melcaldone;
reg [15:0] melout;
wire [14:0] partmelout;
wire [15:0] partMelresult16;
wire [15:0] mel_sel;
reg [14:0] melbankAddr;
reg [8:0]melcalCount;
reg [5:0]mfscoutCount;
melbank U2(.addra(melbankAddr), .clka(clk), .douta(mel_sel), .ena(melbankEnable));

reg logtablefinish;
reg [15:0] log10_cal;

// 50MHz clk
always@(posedge clk or negedge reset) begin
    if(!reset) begin
        div_clk <= 1'b0;
    end
    else begin
        div_clk <= !div_clk;
    end
end

//25MHz clk
reg divdiv_clk;
always@(posedge div_clk or negedge reset) begin
    if(!reset) begin
        divdiv_clk <= 1'b0;
    end
    else begin
        divdiv_clk <= !divdiv_clk;
    end
end

always@(posedge clk, negedge reset) begin
    if(!reset) begin
        CS <= 3'd0;
    end
    else begin
        CS <= NS;
    end
end

always@(*) begin
    case(CS)
        Initial: begin
            if(mfscon == 1'b1)
                NS = HWcal;
            else
                NS = Initial;
        end
        HWcal: begin
            if(select!= 2'd0 && SIread == 1'b1)
                NS = SIwait;
            else
                NS = HWcal;
        end
        SIwait: begin
            if(hammingwindowAddr == 10'd0)
                NS = FFTcal;
            else if(select!= 2'd0 && SIread == 1'b0) // 要�?��?�在?��input??��?��?��?��?�就?��?��??�到HWcal??��?��??
                NS = HWcal;
            else
                NS = SIwait;
        end
        FFTcal: begin
            if(fftfinish == 1'b1)
                NS = Melcal;
            else
                NS = FFTcal;
        end
        Melcal: begin
            if(melcaldone == 1'b1)
                NS = Logtable;
            else
                NS = Melcal;
        end
        Logtable: begin
            if(logtablefinish == 1'b1)
                NS = mfscout;
            else
                NS = Logtable;
        end
        mfscout: begin
            if(log10_result_Wready == 1'b0)
                NS = waitram;
            else
                NS = mfscout;    
        end
        waitram: begin
            if(mfscoutCount == 6'd0 && log10_result_Wready == 1'b1)
                NS = Initial;
            else if(log10_result_Wready == 1'b1)
                NS = Melcal;
            else
                NS = waitram;
        end
        default: NS = Initial;
    endcase
end

always@(posedge clk or negedge reset) begin
    if(!reset) begin
        recent_select <= 2'b00; 
        hammingwindowEnable <= 1'b0;
        fft_s_axis_data_tvalid <= 1'b0;
        fftoff <= 1'b0;
        melbankEnable <= 1'b0;
        melfinish <= 1'b0;
        log10_result_Rready <= 1'b0;
    end
    else begin
        case(CS)
            Initial: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b1;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b0;
                melbankEnable <= 1'b0;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b0;
            end
            HWcal: begin
                recent_select <= select;
                hammingwindowEnable <= 1'b1;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b0;
                melbankEnable <= 1'b0;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b0;   
            end
            SIwait: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b0;
                melbankEnable <= 1'b0;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b0;
            end
            FFTcal: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b1;
                fftoff <= 1'b0;
                melbankEnable <= 1'b1;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b0;
            end
            Melcal: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b1;
                melbankEnable <= 1'b1;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b0;
            end
            Logtable: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b1;
                melbankEnable <= 1'b0;
                melfinish <= 1'b1;
                log10_result_Rready <= 1'b0;
            end
            mfscout: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b1;
                melbankEnable <= 1'b0;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b1;
            end
            waitram: begin
                recent_select <= recent_select;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b1;
                melbankEnable <= 1'b0;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b1;
            end
            default: begin
                recent_select <= 2'b00;
                hammingwindowEnable <= 1'b0;
                fft_s_axis_data_tvalid <= 1'b0;
                fftoff <= 1'b0;
                melbankEnable <= 1'b0;
                melfinish <= 1'b0;
                log10_result_Rready <= 1'b0;
            end
        endcase
    end
end

// hamming calculation
integer idx;
wire [31:0] partHWresult;
reg [31:0] hout0, hout1, hout2, hout3, hout4, hout5, hout6, hout7, hout8, hout9, hout10, hout11, hout12, hout13, hout14, hout15;
always@(*)begin
    hout0 = {32{sound_input[0]}} & { 16'd0, HW_sel[15:0] };
    hout1 = ({31{sound_input[1]}} & { 15'd0, HW_sel[15:0] }) << 1;
    hout2 = ({30{sound_input[2]}} & { 14'd0, HW_sel[15:0] }) << 2;
    hout3 = ({29{sound_input[3]}} & { 13'd0, HW_sel[15:0] }) << 3;
    hout4 = ({28{sound_input[4]}} & { 12'd0, HW_sel[15:0] }) << 4;
    hout5 = ({27{sound_input[5]}} & { 11'd0, HW_sel[15:0] }) << 5;
    hout6 = ({26{sound_input[6]}} & { 10'd0, HW_sel[15:0] }) << 6;
    hout7 = ({25{sound_input[7]}} & { 9'd0, HW_sel[15:0] }) << 7;
    hout8 = ({24{sound_input[8]}} & { 8'd0, HW_sel[15:0] }) << 8;
    hout9 = ({23{sound_input[9]}} & { 7'd0, HW_sel[15:0] }) << 9;
    hout10 = ({22{sound_input[10]}} & { 6'd0, HW_sel[15:0] }) << 10;
    hout11 = ({21{sound_input[11]}} & { 5'd0, HW_sel[15:0] }) << 11;
    hout12 = ({20{sound_input[12]}} & { 4'd0, HW_sel[15:0] }) << 12;
    hout13 = ({19{sound_input[13]}} & { 3'd0, HW_sel[15:0] }) << 13;
    hout14 = ({18{sound_input[14]}} & { 2'd0, HW_sel[15:0] }) << 14;
    hout15 = ({17{sound_input[15]}} & { 1'd0, HW_sel[15:0] }) << 15;
end

assign partHWresult = hout0 + hout1 + hout2 + hout3 + hout4 + hout5 + hout6 + hout7 + hout8 + hout9 + hout10 + hout11 + hout12 + hout13 + hout14 - hout15;
assign partHWresult16 = {partHWresult[31], partHWresult[24:10]};

always@(posedge div_clk or negedge reset) begin
    if(!reset) begin
        hammingwindowAddr <= 10'd0;
        mfscon <= 1'b0;
        bram_count <= 1'b0;
        bram_addr <= 9'd1;
        bram_enable <= 3'b000;
        bram_write_enable <= 1'b0;
        SIread <= 1'b0;
        for(idx=0; idx<1024; idx = idx + 1)begin
            hw_result[idx] <= 16'd0;
        end
    end
    else begin
        case(CS)
            Initial: begin
                SIread <= 1'b0;
                hammingwindowAddr <= 10'd0;
                bram_count <= 1'b0;
                bram_addr <= 9'd1;
                bram_write_enable <= 1'b0;
                if(select != recent_select && select != 2'b00 && bram_enable != 3'b000)
                    mfscon <= 1'b1;
                else
                    mfscon <= 1'b0;
                if(select == 2'd1)
                    bram_enable <= 3'b100;
                else if(select == 2'd2)
                    bram_enable <= 3'b010;
                else if(select == 2'd3)
                    bram_enable <= 3'b001;
                else
                    bram_enable <= 3'b000;
                for(idx=0; idx<1024; idx = idx + 1)begin
                    hw_result[idx] <= 16'd0;
                end
            end
            HWcal: begin
                mfscon <= 1'b0;
                if(select != 2'b00 && SIread == 1'b0) begin
                    SIread <= 1'b1;
                    hammingwindowAddr <= hammingwindowAddr + 10'd1;
                    bram_addr <= bram_addr + 9'd1;
                    bram_write_enable <= bram_write_enable;
                    hw_result[hammingwindowAddr] <= partHWresult16;
                    if(bram_addr == 9'd0 && bram_count != 1'b1) begin
                        if(bram_enable == 3'b000 || bram_enable == 3'b001) begin
                            bram_enable <= 3'b100;
                            bram_count <= 1'b1;
                        end
                        else if(bram_enable == 3'b100) begin
                            bram_enable <= 3'b010;
                            bram_count <= 1'b1;
                        end
                        else if(bram_enable == 3'b010) begin
                            bram_enable <= 3'b001;
                            bram_count <= 1'b1;
                        end
                        else begin
                            bram_enable <= 3'b000;
                            bram_count <= bram_count;
                        end
                    end
                    else begin
                        bram_enable <= bram_enable;
                        bram_count <= bram_count;
                    end
                end
                else begin
                    SIread <= 1'b1;
                    hammingwindowAddr <= hammingwindowAddr;
                    bram_count <= bram_count;
                    bram_addr <= bram_addr;
                    bram_enable <= bram_enable;
                    bram_write_enable <= bram_write_enable;
                    for(idx=0; idx<1024; idx = idx + 1)begin
                        hw_result[idx] <= hw_result[idx];
                    end
                end
            end
            SIwait: begin
                mfscon <= 1'b0;
                SIread <= 1'b0;
                hammingwindowAddr <= hammingwindowAddr;
                bram_count <= bram_count;
                bram_addr <= bram_addr;
                bram_enable <= bram_enable;
                bram_write_enable <= bram_write_enable;
                for(idx=0; idx<1024; idx = idx + 1)begin
                    hw_result[idx] <= hw_result[idx];
                end 
            end
            FFTcal: begin
                mfscon <= 1'b0;
                SIread <= 1'b0;
                hammingwindowAddr <= hammingwindowAddr;
                bram_count <= bram_count;
                bram_addr <= bram_addr;
                bram_enable <= bram_enable;
                bram_write_enable <= bram_write_enable;
                for(idx=0; idx<1024; idx = idx + 1)begin
                    hw_result[idx] <= hw_result[idx];
                end
            end
            default: begin
                mfscon <= 1'b0;
                SIread <= 1'b0;
                hammingwindowAddr <= 10'd0;
                bram_count <= 1'b0;
                bram_addr <= 9'd1;
                bram_enable <= 3'b000;
                bram_write_enable <= 1'b0;
                for(idx=0; idx<1024; idx = idx + 1)begin
                    hw_result[idx] <= 16'd0;
                end
            end
        endcase
    end
end

// fftinput
always@(posedge div_clk or negedge reset) begin
    if(!reset) begin
        fft_input <= 16'd0;
        fftinCount <= 10'd0;
        fft_s_axis_data_tlast <= 1'b0;
    end
    else begin
        if(fft_s_axis_data_tready && fft_s_axis_data_tvalid) begin
            fft_input <= hw_result[fftinCount];
            fftinCount <= fftinCount + 10'd1;
            if(fftinCount == 10'd1023)
                fft_s_axis_data_tlast <= 1'b1;
            else
                fft_s_axis_data_tlast <= 1'b0;
        end
        else begin
            fft_input <= 16'd0;
            fftinCount <= 10'd0;
            fft_s_axis_data_tlast <= 1'b0;
        end
    end
end

//fft restoration
always@(posedge div_clk or negedge reset) begin
    if(!reset) begin
        for(idx=0; idx<512; idx = idx + 1)begin
            fft_result[idx] <= 16'd0;
        end
        fftoutCount <= 9'd0;
        fftfinish <= 1'b0;
    end
    else begin
        if(fft_m_axis_data_tvalid && fft_data_tvalid && fftoff == 1'b0) begin
            fft_result[fftoutCount] <= fftout;
            fftoutCount <= fftoutCount + 9'd1;
            if(fftoutCount == 9'd511)
                fftfinish <= 1'b1;
            else
                fftfinish <= 1'b0;
        end
        else begin
            for(idx=0; idx<512; idx = idx + 1)begin
                fft_result[idx] <= fft_result[idx];
            end
            fftoutCount <= 9'd0;
            fftfinish <= 1'b0; 
        end
    end
end

//melfilter
wire [31:0] partMelresult;
reg [31:0] mout0, mout1, mout2, mout3, mout4, mout5, mout6, mout7, mout8, mout9, mout10, mout11, mout12, mout13, mout14, mout15;
always@(*)begin
    mout0 = {32{fft_result[melcalCount][0]}}&{16'd0, mel_sel[15:0]};
    mout1 = {{31{fft_result[melcalCount][1]}}&{15'd0, mel_sel[15:0]}, 1'd0};
    mout2 = {{30{fft_result[melcalCount][2]}}&{14'd0, mel_sel[15:0]}, 2'd0};
    mout3 = {{29{fft_result[melcalCount][3]}}&{13'd0, mel_sel[15:0]}, 3'd0};
    mout4 = {{28{fft_result[melcalCount][4]}}&{12'd0, mel_sel[15:0]}, 4'd0};
    mout5 = {{27{fft_result[melcalCount][5]}}&{11'd0, mel_sel[15:0]}, 5'd0};
    mout6 = {{26{fft_result[melcalCount][6]}}&{10'd0, mel_sel[15:0]}, 6'd0};
    mout7 = {{25{fft_result[melcalCount][7]}}&{9'd0, mel_sel[15:0]}, 7'd0};
    mout8 = {{24{fft_result[melcalCount][8]}}&{8'd0, mel_sel[15:0]}, 8'd0};
    mout9 = {{23{fft_result[melcalCount][9]}}&{7'd0, mel_sel[15:0]}, 9'd0};
    mout10 = {{22{fft_result[melcalCount][10]}}&{6'd0, mel_sel[15:0]}, 10'd0};
    mout11 = {{21{fft_result[melcalCount][11]}}&{5'd0, mel_sel[15:0]}, 11'd0};
    mout12 = {{20{fft_result[melcalCount][12]}}&{4'd0, mel_sel[15:0]}, 12'd0};
    mout13 = {{19{fft_result[melcalCount][13]}}&{3'd0, mel_sel[15:0]}, 13'd0};
    mout14 = {{18{fft_result[melcalCount][14]}}&{2'd0, mel_sel[15:0]}, 14'd0};
    mout15 = {{17{fft_result[melcalCount][15]}}&{1'd0, mel_sel[15:0]}, 15'd0};
end

assign partMelresult = mout0 + mout1 + mout2 + mout3 + mout4 + mout5 + mout6 + mout7 + mout8 + mout9 + mout10 + mout11 + mout12 + mout13 + mout14 - mout15;
assign partMelresult16 = {1'b0, partMelresult[24:10]};

always@(posedge divdiv_clk or negedge reset) begin
    if(!reset) begin
        melout <= 16'd0;
        melcalCount <= 9'd0;
        melbankAddr <= 15'd0;
        melcaldone <= 1'b0;
    end
    else begin
        case(CS)
            Melcal: begin
                if(fftoff == 1'b1) begin
                    melout <= melout + partMelresult16;
                    melcalCount <= melcalCount + 9'd1;
                    melbankAddr <= melbankAddr + 15'd1;
                    if(melcalCount == 9'd511)
                        melcaldone <= 1'b1;
                    else
                        melcaldone <= 1'b0;
                end
                else begin
                    melout <= melout;
                    melcalCount <= melcalCount;
                    melbankAddr <= melbankAddr;
                    melcaldone <= 1'b0;
                end
            end
            Logtable: begin
                melout <= melout;
                melcalCount <= 9'd0;
                melbankAddr <= melbankAddr;
                melcaldone <= 1'b0;
            end
            mfscout: begin
                melout <= 16'd0;
                melcalCount <= 9'd0;
                melbankAddr <= melbankAddr;
                melcaldone <= 1'b0;
            end
            waitram: begin
                melout <= 16'd0;
                melcalCount <= 9'd0;
                melbankAddr <= melbankAddr;
                melcaldone <= 1'b0;
            end
            default: begin
                melout <= 16'd0;
                melcalCount <= 9'd0;
                melbankAddr <= 15'd0;
                melcaldone <= 1'b0;
            end
        endcase
    end
end

assign partmelout = melout[14:0];

