always@(*)begin
    rout0 = {{32{after_fft_data[0]}}}&{{16{after_fft_data[15]}}, after_fft_data[15:0]};
    rout1 = {{31{after_fft_data[1]}}&{{15{after_fft_data[15]}}, after_fft_data[15:0]}, 1'd0};
